import React, { useEffect, useState } from 'react'
import axios from 'axios'
import { useHistory, useParams } from 'react-router-dom'
import {Box} from '@material-ui/core';
import '../master.css'
import styled from 'styled-components';
import '../master.css'
import { TextButton,ButtonEnter } from '../theme/Tema';
import { BackgroundDiv, BoxInfoRepo, NamePage, BoxGrid } from '../theme/Tema';



function Repos_url() {
const params = useParams().username
const [infoRepo, setInfoRepo] = useState([]) 
const history = useHistory()
const [starred, setStarred] = useState([])
useEffect(()=>{
  user_repo()
validStarred()
},[])

  const user_repo = () => {
    axios.get(`https://api.github.com/users/${params}/repos`)
      .then((res) => {
        setInfoRepo(res.data)
        
      }).catch((err) => {
        alert(err)

      })
  }

  const map_repositorios = infoRepo.map((repo)=>{
     return(
         <BoxInfoRepo key = {repo.id}>     
        <p id = 'nameRepo'>{repo.name}</p>

      </BoxInfoRepo> 
   
     ) 
  })
console.log(params)
  const validStarred = () => {
    axios.get(`https://api.github.com/users/${params}/starred`)
      .then((res) => {
        console.log(res.data)
        
       setStarred(res.data)
    
      }).catch((err) => {
        alert(err.messege)

      })
  }

const goStarred = () => {
  if(starred.length === 0){
    alert("Não há Starred's")
  }else{
    history.push(`/users/${params}/starred`)
  }

}

  return (
    <BackgroundDiv>
        <Box bgcolor = 'white' height = '100px'>
      <NamePage className = 'iconP'>Repositórios</NamePage>
      </Box>
      <BoxGrid display= 'flex'>
        {map_repositorios}
      </BoxGrid>
      <Box display = 'flex'>
        <IconBack src = 'https://cdn4.iconfinder.com/data/icons/ionicons/512/icon-ios7-arrow-left-512.png'>

        </IconBack>
      </Box>
      <Box display = 'flex' justifyContent = 'center'>
        <ButtonEnter onClick = {goStarred}>
      <TextButton >Starred</TextButton>
      </ButtonEnter>
      </Box>
      
    </BackgroundDiv>
    
    );
  }
  
  export default Repos_url;
